import React,{useEffect,useState} from 'react'
import {useSelector,useDispatch} from 'react-redux'

import './infoPage.scss'
import PieChart1 from './pieChart1'
import PieChart2 from './pieChart2'
import {
    getTransactionalTables,
    getClickStreamTables,
    getSummaryTables,
    getStaleTransactionalTables,
    getStaleClickStreamTables,
    getStaleSummaryTables,
    getFreshTransactionalTables,
    getFreshClickStreamTables,
    getFreshSummaryTables,
    getProcessedRecords,
    getAdhocRun,
} from '../../../actions/dataActions'


export default function InfoPage() {

    const [activeLegendIndex,setActiveLegendIndex]=useState(null)
    const [queryContent,setQueryContent]=useState('')
    const [format,setFormat]=useState('PARQUET')



    const dispatch=useDispatch()

    const id=useSelector((state) => state.dataReducer.selectedTenant)
    const staleTransactionalEvents=useSelector((state) => state.dataReducer.staleTransactionalEvents)
    const staleBehavioralEvents=useSelector((state) => state.dataReducer.staleBehavioralEvents)
    const staleComputedEvents=useSelector((state) => state.dataReducer.staleComputedEvents)
    const freshTransactionalEvents=useSelector((state) => state.dataReducer.freshTransactionalEvents)
    const freshBehavioralEvents=useSelector((state) => state.dataReducer.freshBehavioralEvents)
    const freshComputedEvents=useSelector((state) => state.dataReducer.freshComputedEvents)
    const processedRecords=useSelector((state) => state.dataReducer.processedRecords)
    const authenticationData=useSelector((state) => state.dataReducer.authenticationData)

    const AdhocRunResponse=useSelector((state) => state.dataReducer.AdhocRunResponse)
    const showAdhocRunResult=useSelector((state) => state.dataReducer.showAdhocRunResult)




    const handleDurationChange=(e) => {
        const days=e.target.value
        dispatch(getClickStreamTables(id))
        dispatch(getSummaryTables(id))
        dispatch(getTransactionalTables(id))
        dispatch(getStaleClickStreamTables(id,days))
        dispatch(getStaleTransactionalTables(id,days))
        dispatch(getStaleSummaryTables(id,days))
        dispatch(getFreshClickStreamTables(id,days))
        dispatch(getFreshTransactionalTables(id,days))
        dispatch(getFreshSummaryTables(id,days))
        const activeLegend=document.getElementsByClassName('active-legend')[0]
        if(activeLegend) {
            activeLegend.className='inactive-legend'
        }
    }

    const handleRecordChange=(e) => {
        dispatch(getProcessedRecords(id,e.target.value))
    }
    const handlequeryChange=(e) => {
        setQueryContent(e.target.value)

        // dispatch(getProcessedRecords(id,e.target.value))
    }
    console.log(id,'id....');
    const handleAdhocRun=(e) => {
        let currentDate=new Date().toLocaleDateString().replaceAll('/','-')
        // console.log(currentDate,'currentDate');
        let data={
            // for live uncomment below
            // "emailAlerting": `${authenticationData.userType}`,
            // "createdBy": `${authenticationData.userType}`,


            // for live comment below
            "createdBy": "tarun.dev@infoedge.com",
            "emailAlerting": "tarun.dev@infoedge.com",
            "query": `${queryContent}`,
            // "query": "query",



            "jobName": "test1",
            "queryName": "test1",
            "bucketName": "",
            "tenantId": id,

            "destinationType": "DATA_LAKE_S3",
            "category": "SMALL",
            "cronExpression": "",
            "persisted": false,
            "date": `${currentDate}`,
            "saveFormat": `${format}`
        }
        // console.log(data,'data');

        dispatch(getAdhocRun(data))

        // setQueryContent(e.target.value)


        // dispatch(getProcessedRecords(id,e.target.value))
    }

    const handleSaveForamt=(e) => {
        // console.log(e.target.value,'saveformat');
        setFormat(e.target.value)
    }

    useEffect(() => {
        if(staleTransactionalEvents.length===0) {
            dispatch(getStaleClickStreamTables(id,7))
        }
        if(staleBehavioralEvents.length===0) {
            dispatch(getStaleTransactionalTables(id,7))
        }
        if(staleComputedEvents.length===0) {
            dispatch(getStaleSummaryTables(id,7))
        }
        if(freshTransactionalEvents.length===0) {
            dispatch(getFreshClickStreamTables(id,7))
        }
        if(freshBehavioralEvents.length===0) {
            dispatch(getFreshTransactionalTables(id,7))
        }
        if(freshComputedEvents.length===0) {
            dispatch(getFreshSummaryTables(id,7))
        }
        if(processedRecords.length===0) {
            dispatch(getProcessedRecords(id,1000000))
        }

    },[])

    const countSelector=document.getElementsByClassName('count-selector')[0]
    let minProcessedRecords='10 Lakhs'
    if(countSelector) {
        if(countSelector.value==='1000000') {
            minProcessedRecords='10 Lakhs'
        } else if(countSelector.value==='5000000') {
            minProcessedRecords='50 Lakhs'
